(1, 'tenga-en-cuenta-que-la-css-para-estos-disenos-cuenta-con-numerosos-comentarios', 'Tenga en cuenta que la CSS para estos diseÃ±os cuenta con numerosos comentarios.', 'Tenga en cuenta que la CSS para estos diseÃ±os cuenta con numerosos comentarios. Si realiza la mayor parte de su trabajo en la vista DiseÃ±o', 'Tenga en cuenta que la CSS para estos diseÃ±os cuenta con numerosos comentarios. Si realiza la mayor parte de su trabajo en la vista DiseÃ±o, eche un vistazo al cÃ³digo para obtener sugerencias sobre cÃ³mo trabajar con la CSS para diseÃ±os flotantes. Puede quitar estos comentarios antes de lanzar el sitio. Para obtener mÃ¡s informaciÃ³n sobre las tÃ©cnicas usadas en estos diseÃ±os CSS, lea este artÃ­culo en el Centro de desarrolladores de Adobe:', 'http://192.168.100.12/NUEVO_ADMIN/VERSION2/archivos/banner-principal/Banner-14.jpg', 1, 0, '2014-11-19 15:09:57', '2014-12-09 18:03:08', 'admin', 'admin');

