(17, 'ALEJANDRA LOYOLA', 'alejandra-loyola', 'Ingeniero Comercial Pontificia Universidad Católica de Chile', '<ul><li>Alejandra es Socia en The<strong>House</strong> y ha liderado proyectos de consultoría estratégica con empresas de retail, banca, servicios financieros, turismo e industria. Es experta en procesos de desarrollo organizacional, gestión de personas, desarrollo de liderazgos y transformación cultural.</li><br><li>Antes de fundar The<strong>House</strong>, Alejandra fue Vicepresidenta de Desarrollo Corporativo en Matrix Consulting donde obtuvo el primer lugar en Great Place to Work 2012. Previo a esto, trabajó 4 años como Gerente Desarrollo Corporativo en la misma empresa, adquiriendo amplia destreza gerencial en la industria financiera, del retail y consumo masivo. Adicionalmente, es Consejera de la Fundación CEAUC y Miembro del Comité de Capital Humano de la AMCHAM.</li><br><li>Alejandra es Ingeniero Comercial de la Pontificia Universidad Católica de Chile y posee un MBA en la misma universidad, tiene un Diplomado de Liderazgo y Coaching y una Certificación en Coaching Organizacional en la Universidad Adolfo Ibáñez.</li></ul>', 'http://thehouse.extenddigital.cl/archivos/equipo/a_loyola.jpg', '', '', 2, 1, 0, '', '', '', 'https://cl.linkedin.com/in/alejandra-loyola-57236211', '2015-03-20 10:23:32', '2018-07-26 12:32:07', 'admin', 'fran', 'aloyola@thehouse.cl', 'Socia', 'http://thehouse.extenddigital.cl/archivos/equipo/a_loyola_2.jpg'),
(21, 'JUAN PABLO ARRIAGADA', 'juan-pablo-arriagada', 'Ingeniero Comercial  Universidad de Chile', '<ul><li>Juan Pablo es Consultor en The<strong>House</strong> y ha trabajado en procesos de planificación, evaluación de branding y gestión organizacional en empresas de retail, financieras y servicios públicos.</li><br><li>Antes de entrar a The<strong>House</strong>, Juan Pablo trabajó como consultor e investigador en In Situ Chile. Adicionalmente, participó activamente en TECHO y en un programa de voluntariado en Uganda a través de ONG Cooperating Volunteers.</li><br><li>Juan Pablo es Ingeniero Comercial con mención en Economía de la Universidad de Chile.</li></ul>', 'http://thehouse.extenddigital.cl/archivos/equipo/j_arriagada.jpg', '', '', 6, 1, 0, '', '', '', 'https://www.linkedin.com/in/juan-pablo-arriagada-larrain-19858a119/', '2015-03-20 12:53:42', '2018-07-26 12:25:56', 'admin', 'fran', 'jparriagada@thehouse.cl', 'Consultor', 'http://thehouse.extenddigital.cl/archivos/equipo/j_arriagada2.jpg'),
(24, 'FRANCISCA ECHAVARRÍA', 'francisca-echavarra?a', 'Ingeniero Comercial                     Universidad de Chile', '<ul><li>Francisca es Subgerente de Desarrollo y ha liderado una serie de proyectos de innovación para canales de distribución, estrategias de comercialización y marketing, proyectos de RR.HH., entre otros.</li><br><li>Antes de entrar a The<strong>House</strong>, Francisca trabajó 10 años en Seguros Interamericana y Metlife, donde adquirió una amplia experiencia en la industria de intangibles, en áreas comerciales y de marketing. Previo a esto, participó en el desarrollo del canal de agencias, su respectivo esquema de operación, incentivos, capacitación y eventos. Debido a su trayectoria, obtuvo la posibilidad de participar en el programa de “Entrenamiento de jóvenes talentos” en AIG, Seúl, Corea.</li><br><li>Francisca es Ingeniero Comercial de la Universidad de Chile y posee un Diploma en Liderazgo y Coaching en la Universidad Adolfo Ibáñez y un Diploma en Marketing en la misma universidad.</li></ul>', 'http://thehouse.extenddigital.cl/archivos/equipo/f_echeverria.jpg', '', '', 9, 0, 0, '', '', '', 'https://cl.linkedin.com/in/marÃ­a-francisca-echavarrÃ­a-eikhof-5722811a', '2015-03-20 12:59:31', '2018-08-23 15:55:34', 'admin', 'fran', 'fechavarria@thehouse.cl', 'Subgerente de Desarrollo', 'http://thehouse.extenddigital.cl/archivos/equipo/f_echeverria2.jpg'),
(28, 'NATALIA CORTÁZAR', 'natalia-corta?zar', 'Ingeniero Comercial Pontificia Universidad Católica de Chile', '<ul><li>Natalia es Gerente de Proyectos en The<strong>House</strong> y ha trabajado en procesos de gestión de proyectos, negociación y manejo de equipos. Lideró proyectos internacionales de alta inversión en LAN, como el Boeing 787 Dreamliner, Airbus 350, entre otros.</li><br><li>Antes de entrar a The<strong>House</strong>, Natalia trabajó como Subgerente de LATAM donde participó de la integración de LAN y TAM y lideró un portafolio de proyectos. Adicionalmente, realizó un proyecto de consultoría al British Business Bank en Londres sobre el acceso a financiamiento de PYMES.</li><br><li>Natalia es Ingeniero Comercial de la Pontificia Universidad Católica de Chile y posee un Master in Public Administration en London School of  Economics.</li></ul>', 'http://thehouse.extenddigital.cl/archivos/equipo/fondo-3-copia.png', '', '', 13, 1, 0, '', '', '', 'https://cl.linkedin.com/in/natalia-cortazar-24a835b1/es', '2016-05-06 17:31:41', '2018-08-23 15:44:53', 'fran', 'fran', 'ncortazar@thehouse.cl', 'Gerente de Proyectos', 'http://thehouse.extenddigital.cl/archivos/equipo/fondo-3-A.png'),
(29, 'VÍCTOR ALASTUEY', 'va', 'Ingeniero Civil Industrial Pontificia Universidad Católica de Chile', '<ul><li>Víctor es Gerente de Proyectos en The<strong>House</strong> y ha liderado proyectos de planificación estratégica, desarrollo organizacional y movilización de iniciativas complejas en industrias tan variadas como minería, financiera, retail, celulosa, entre otros.</li><br><li>Antes de entrar a The<strong>House</strong>, Víctor trabajó como Consultor Senior en PRAGMAXION. Previo a esto, participó en áreas comerciales y de planificación en Indumotora y CCU Chile. Adicionalmente, fue profesor titular en la carrera de Ingeniería Civil Industrial en la Universidad de Chile y profesor auxiliar en el curso “Change Management” del Global MBA de la misma universidad.</li><br><li>Víctor es Ingeniero Civil Industrial de la Pontificia Universidad Católica de Chile y posee un MBA en Cranfield University y un Global MBA en la Universidad de Chile.</li></ul>', 'http://thehouse.extenddigital.cl/archivos/equipo/v_alastuey.jpg', '', '', 1, 1, 0, '', '', '', 'https://cl.linkedin.com/in/victoralastuey', '2016-05-06 17:40:15', '2018-07-26 12:29:19', 'fran', 'fran', 'valastuey@thehouse.cl', 'Gerente de Proyectos', 'http://thehouse.extenddigital.cl/archivos/equipo/v_alastuey2.jpg'),
(31, 'TOMÁS TAPIA', 'toma', 'Ingeniero Civil Industrial  Universidad de los Andes', '<ul><li>Tomás es Consultor en The<strong>House</strong> y ha trabajado en proyectos de desarrollo organizacional, planificación estratégica, optimización de procesos y estudios benchmark en la industria de la minería nacional e internacional, así como en la implementación de soluciones tecnológicas en minería y telecomunicaciones.</li><br><li>Antes de entrar a The<strong>House</strong>, Tomás trabajó como Consultor en VANTAZ Group, donde participó en proyectos de estrategia y productividad en la industria minera. Previo a esto, realizó su práctica profesional en TFC Soluciones y GTD Telecomunicaciones.</li><br><li>Tomás es Ingeniero Civil Industrial de la Universidad de Los Andes.</li></ul>', 'http://thehouse.extenddigital.cl/archivos/equipo/t_tapia.jpg', '', '', 10, 1, 0, '', '', '', 'https://www.linkedin.com/in/tomas-tapia-71976353/', '2016-05-06 19:19:06', '2018-07-26 12:31:43', 'fran', 'fran', 'ttapia@thehouse.cl', 'Consultor', 'http://thehouse.extenddigital.cl/archivos/equipo/t_tapia2.jpg'),
(32, 'TERESA POCH', 'teresa-poch', 'Secretaria Intérprete en Inglés Instituto de Formación Técnica Ites', '<ul><li>Teresa es Asistente Administrativa en The<strong>House</strong> y ha trabajado apoyando las áreas de administración, con sólidos conocimientos técnicos en el área bancaria, especialmente en Inversión.</li><br><li>Antes de entrar a The<strong>House</strong>, Teresa trabajó como Secretaria Administrativa bilingüe en Ernst &amp; Young. Previo a esto, trabajó como Secretaria Ejecutiva en el Banco Santander y como Ejecutiva de Inversiones en Banco Compass Consorcio.</li><br><li>Teresa es Secretaria Intérprete en Inglés del Instituto de Formación Técnica Ites.</li></ul>', 'http://thehouse.extenddigital.cl/archivos/equipo/t_poch.jpg', '', '', 16, 1, 0, '', '', '', 'https://www.linkedin.com/in/teresa-poch-ernst-855a196a/', '2016-05-06 19:23:18', '2018-07-26 12:30:53', 'fran', 'fran', 'tpoch@thehouse.cl', 'Asistente Administrativa', 'http://thehouse.extenddigital.cl/archivos/equipo/t_poch2.jpg'),
(35, 'JOSÉ MIGUEL SEPÚLVEDA', 'josa', 'Ingeniero Civil Industrial Pontificia Universidad Católica de Chile', '<ul><li>José Miguel es Socio en The<strong>House</strong> y cuenta con más de 20 años de experiencia liderando proyectos de consultoría estratégica asesorando empresas en industrias tan variadas como minería, retail, finanzas, servicios y transporte, entre otras.  Es experto en el desarrollo de estrategias de crecimiento, organización y procesos de gestión.</li><br><li>Antes de fundar The<strong>House</strong>, José Miguel fue socio fundador de Matrix Consulting, donde trabajó 10 años.  Previo a esto, trabajó en el equipo de Finanzas Corporativas de JP Morgan en Londres.</li><br><li>José Miguel es Ingeniero Civil Industrial de la Pontificia Universidad Católica de Chile y posee un MBA en Harvard Business School.</li></ul>', 'http://thehouse.extenddigital.cl/archivos/equipo/jm_sepulveda.jpg', '', '', 1, 1, 0, '', '', '', 'https://cl.linkedin.com/in/jose-miguel-sepulveda-151500/es', '2016-05-19 09:38:36', '2018-07-26 12:24:39', 'fran', 'fran', 'jsepulveda@thehouse.cl', 'Socio', 'http://thehouse.extenddigital.cl/archivos/equipo/jm_sepulveda2.jpg'),
(36, 'JUAN DIEGO COVARRUBIAS', 'juan-diego-covarrubias', 'Ingeniero Comercial Universidad de Los Andes', '<ul><li>Antes de entrar a The<strong>House</strong>, Juan Diego realizó un programa de entrenamiento semestral como Analista de Portafolios de Inversión en el departamento de Estrategia de LarrainVial. Adicionalmente, fue organizador en diversos proyectos sociales: Funde, Obradores, La vega, entre otros.</li><br><li>Diego es Consultor en The<strong>House</strong> y ha trabajado en proyectos de planificación estratégica y gestión de procesos, tanto en el sector público como en la industria minera.</li><br><li>Juan Diego es Ingeniero Comercial de la Universidad de Los Andes.</li></ul>', 'http://thehouse.extenddigital.cl/archivos/equipo/j_covarrubias.jpg', '', '', 17, 1, 0, '', '', '', 'https://www.linkedin.com/in/juan-diego-covarrubias-ross-100856b7/', '2016-09-20 09:33:45', '2018-07-26 12:33:16', 'gabriel', 'fran', 'jdcovarrubias@thehouse.cl', 'Consultor', 'http://thehouse.extenddigital.cl/archivos/equipo/j_covarrubias2.jpg'),
(37, 'NICOLÁS DÍAZ', 'nicola', 'Ingeniero Civil Industrial Pontificia Universidad Católica de Chile', '<ul><li>Nicolás es Consultor en The<strong>House</strong> y ha trabajado en procesos de planificación estratégica, evaluación de líneas de negocio, instalación de modelos operativos y gestión del cambio en industrias como minería, energía y seguros de vida. </li><br><li>Antes de entrar a The<strong>House</strong>, Nicolás realizó su práctica profesional como Ingeniero de Estudios Estratégicos y Control de Gestión en Codelco, División El Teniente. También fue partícipe y presentador del XVII Encuentro de Gestión de Activos Físicos (EGAF).</li><br><li>Nicolás es Ingeniero Civil Industrial de la Pontificia Universidad Católica de Chile con mención en Minería y realizó un intercambio académico en la Università Commerciale Luigi Bocconi, Milán, Italia.</li></ul>', 'http://thehouse.extenddigital.cl/archivos/equipo/n_diaz.jpg', '', '', 18, 1, 0, '', '', '', 'https://www.linkedin.com/in/nicol%C3%A1s-ignacio-d%C3%ADaz-cancino-458340120', '2016-09-20 09:42:29', '2018-07-26 12:26:17', 'gabriel', 'fran', 'ndiaz@thehouse.cl', 'Consultor', 'http://thehouse.extenddigital.cl/archivos/equipo/n_diaz2.jpg'),
(38, 'PABLO CRUZ', 'pablo-cruz', 'Ingeniero Comercial Pontificia Universidad Católica de Chile', '<ul><li>Pablo es Consultor en The<strong>House</strong> y ha trabajado en consultoría estratégica en la industria minera. Cuenta con experiencia en gestión de PYMES, análisis de fondos financieros y activos alternativos.</li><br><li>Antes de entrar a The<strong>House</strong>, Pablo fue fundador de la marca chilena de productos de cuero Trauko Chile. Realizó su práctica profesional como Analista en Selección de Fondos y Productos en el departamento de Estrategia de LarrainVial. Adicionalmente, creó la empresa de regalos corporativos Kaleuche SpA.</li><br><li>Pablo es Ingeniero Comercial de la Pontificia Universidad Católica de Chile y realizó un intercambio académico en UNC Charlotte Belk College of Business, North Carolina, Estados Unidos.</li></ul>', 'http://thehouse.extenddigital.cl/archivos/equipo/p_cruz.jpg', '', '', 19, 1, 0, '', '', '', 'https://www.linkedin.com/in/pablo-cruz-fern%C3%A1ndez-1a21b014a/', '2016-09-20 09:54:16', '2018-07-26 12:29:41', 'gabriel', 'fran', 'pcruz@thehouse.cl', 'Consultor', 'http://thehouse.extenddigital.cl/archivos/equipo/p_cruz2.jpg'),
(40, 'PILAR COFRÉ', 'pilar-cofra', 'Contador Auditor Escuela de Contadores Auditores de Santiago', '<ul><li>Pilar es Jefe de Administración y Contabiliad y ha trabajado administrando el área financiera y contable de empresas Jurídicas, educacionales, textiles, entre otros.</li><br><li>Antes de entrar a The<strong>House</strong>, Pilar trabajó 10 años como Contador General del Estudio Jurídico Hermosilla y Compañía. Previo a esto, desarrolló su carrera desempeñándose como Contador en la empresa textil Giaverini y como Asistente Contable en Inacap Capacitación. Adicionalmente, trabajó de manera independiente durante 4 años asesorando contable y tributariamente a empresas de distintos rubros.</li><br><li>Pilar posee un Diplomado en Planificación Tributaria en la Universidad de Chile, y es Contador Auditor de la Escuela de Contadores Auditores de Santiago.</li></ul>', 'http://thehouse.extenddigital.cl/archivos/equipo/p_cofre02.jpg', '', '', 0, 1, 0, '', '', '', 'https://www.linkedin.com/in/pilar-cofre-reyes-7250b266/', '2017-05-18 11:23:39', '2018-07-26 12:33:34', 'fran', 'fran', 'pcofre@thehouse.cl', 'Jefe de Administraci&oacute;n y Contabilidad', 'http://thehouse.extenddigital.cl/archivos/equipo/p_cofre01.jpg'),
(41, 'ALFONSO UNDURRAGA', 'alfonso-undurraga', 'Ingeniero Civil Industrial Pontificia Universidad Católica de Chile', '<ul><li>Alfonso es Consultor en The<strong>House</strong> y ha trabajado en procesos de planificación estratégica, desarrollo y gestión de transformación en importantes empresas mineras, servicios públicos, recursos naturales e instituciones sin fines de lucro.</li><br><li>Antes de entrar a The<strong>House</strong>, Alfonso realizó su práctica profesional como Ingeniero Analista de SGD en Codelco, División Andina. También fue partícipe y presentador del XV Encuentro de Gestión de Activos Físicos (EGAF).  Adicionalmente, ha sido colaborador y voluntario en diversos proyectos sociales: Misión País, Trabajo País, Arde Puente Alto y TECHO.</li><br><li>Alfonso es Ingeniero Civil Industrial de la Pontificia Universidad Católica de Chile con mención en Minería.</li></ul>', 'http://thehouse.extenddigital.cl/archivos/equipo/a_undurraga.jpg', '', '', 0, 1, 0, '', '', '', 'https://www.linkedin.com/in/luis-alfonso-undurraga-bordeu-39773a64/', '2017-05-18 11:30:12', '2018-07-26 12:25:02', 'fran', 'fran', 'aundurraga@thehouse.cl', 'Consultor', 'http://thehouse.extenddigital.cl/archivos/equipo/a_undurraga2.jpg'),
(42, 'VICENTE LOYOLA', 'vicente-loyola', 'Ingeniero Comercial Pontificia Universidad Católica de Chile', '<ul><li>Vicente es Consultor en The<strong>House</strong> y ha trabajado en procesos de planificación estratégica, evaluación de proyectos y desarrollo organizacional en industrias tales como minería, seguros, celulosa y finanzas.</li><br><li>Antes de entrar a The<strong>House</strong>, Vicente trabajó como Analista del Departamento de Estudios del Ministerio de Educación. Previo a esto, se desempeñó como Ayudante de investigación en el Centro de Políticas Comparadas en Educación (CPCE) de la Universidad Diego Portales, y realizó su práctica profesional en el Departamento de Activos Alternativos y Estrategia AFP Provida. Adicionalmente, ha participado como coordinador del programa Fomento Productivo y jefe de proyecto para construcciones de secundarios en TECHO.</li><br><li>Vicente es Ingeniero Comercial con mención en Economía de la Pontificia Universidad Católica de Chile y posee un Master en Economía con mención en Políticas Públicas en la misma universidad.</li></ul>', 'http://thehouse.extenddigital.cl/archivos/equipo/v_loyola.jpg', '', '', 0, 1, 0, '', '', '', 'https://www.linkedin.com/in/vicente-loyola-schmidt-66a06140/', '2017-07-11 13:30:08', '2018-07-26 12:25:38', 'fran', 'fran', 'vloyola@thehouse.cl', 'Consultor', 'http://thehouse.extenddigital.cl/archivos/equipo/v_loyola2.jpg'),
(43, 'JAVIER URIBE', 'javier-uribe', 'Ingeniero Civil Industrial Pontificia Universidad Católica de Chile', '<ul><li>Javier es Consultor Senior y ha liderado proyectos de gestión del gasto, planificación y traducción estratégica en importantes industrias a nivel nacional.</li><br><li>Antes de entrar a The<strong>House</strong>, Javier trabajó como Consultor Senior en Aquanima S.A. del Grupo Santander en proyectos de Strategic Sourcing para cliente interno (Banco Santander) y clientes externos (retail, seguros, otros). Previo a esto, trabajó como Consultor en Symnetics Chile donde participó en proyectos de excelencia operacional y planificación estratégica. Adicionalmente, se desempeñó como ayudante de cátedras del curso de Finanzas de la Pontificia Universidad Católica de Chile.</li><br><li>Javier es Ingeniero Civil Industrial de la Pontificia Universidad Católica de Chile.</li></ul>', 'http://thehouse.extenddigital.cl/archivos/equipo/j_uribe.jpg', '', '', 0, 1, 0, '', '', '', 'https://www.linkedin.com/in/javier-uribe-soberon-b34b49a2/?ppe=1', '2017-07-11 13:38:15', '2018-07-26 12:31:24', 'fran', 'fran', 'juribe@thehouse.cl', 'Consultor Senior', 'http://thehouse.extenddigital.cl/archivos/equipo/j_uribe2.jpg'),
(44, 'PAOLA SANTANA', 'paola-santana', 'Ingeniero Comercial Pontificia Universidad Católica  de Chile', '<ul><li>Paola es Gerente General en The<strong>House</strong> y ha liderado procesos de compensaciones, planificación, desarrollo organizacional, gestión y administración de empresas en banca, industrial, seguros, servicios legales y organizaciones sin fines de lucro vinculadas al sector público.</li><br><li>Antes de entrar a The<strong>House</strong>, Paola trabajó 4 años como Gerente General en el estudio Alcaíno Abogados. Previo a esto, desarrollo su carrera desempeñándose como Subgerente de Compensaciones y Procesos en Corpvida, y Director Nacional de Recursos Humanos en la Fundación PRODEMU, entre otros.</li><br><li>Paola es Ingeniero Comercial de la Pontificia Universidad Católica de Chile.</li></ul>', 'http://thehouse.extenddigital.cl/archivos/equipo/p_santana.jpg', '', '', 0, 0, 0, '', '', '', 'https://www.linkedin.com/in/paolasantanaprado/', '2017-07-11 13:50:04', '2018-08-23 15:55:20', 'fran', 'fran', 'psantana@thehouse.cl', 'Gerente General', 'http://thehouse.extenddigital.cl/archivos/equipo/p_santana2.jpg'),
(45, 'PABLO GONZÁLEZ', 'pablo-gonza', 'Ingeniero Civil Industrial Pontificia Universidad Católica de Chile', '<ul><li>Pablo es Consultor Senior en The<strong>House</strong> y ha liderado procesos de evaluación estratégica de proyectos, análisis de riesgos y pronósticos de precios e insumos en minería. Ha participado en proyectos de planificación estratégica, definición de modelo de negocios y eficiencia. Adicionalmente, posee sólida experiencia en la definición e implementación de PMO en distintas empresas</li><br><li>Antes de entrar a The<strong>House</strong>, Pablo trabajó como Gerente de Riesgo en Fondo Esperanza donde adquirió una amplia destreza liderando y formando equipos, gestionando proyectos, estructurando áreas y ocupando puestos de alta responsabilidad. Previo a esto, desarrollo su carrera desempeñándose como Gerente de Planificación Estratégica en LATAM Airlines donde se desarrolló en áreas de control de gestión, procesos, estudios planificación estratégica y riesgos.</li><br><li>Pablo es Ingeniero Civil Industrial de la Pontificia Universidad Católica de Chile y posee un MBA en la misma universidad.</li></ul>', 'http://thehouse.extenddigital.cl/archivos/equipo/p_gonzalez.jpg', '', '', 0, 1, 0, '', '', '', 'https://www.linkedin.com/in/pagonzalezm/', '2017-09-20 10:21:14', '2018-07-26 12:34:56', 'fran', 'fran', 'pgonzalez@thehouse.cl', 'Consultor Senior', 'http://thehouse.extenddigital.cl/archivos/equipo/p_gonzalez2.jpg'),
(46, 'JOSÉ IGNACIO VILLAR', 'josa', 'Ingeniero Comercial Universidad de Chile', '<ul><li>Ignacio es Consultor en The<strong>House</strong> y ha trabajado en proyectos de control de gestión, planificación estratégica y planificación financiera, principalmente en industrias de retail y alimentos. Cuenta con experiencia en valoración de empresas y proyectos, con mayor foco en la industria minera y eléctrica.</li><br><li>Antes de entrar a The<strong>House</strong>, José Ignacio trabajó como Consultor en Business Decision Group. Previo a esto, realizó su práctica profesional en Estrategias de Inversión en EuroAmerica.</li><br><li>José Ignacio es Ingeniero Comercial de la Universidad de Chile.</li></ul>', 'http://thehouse.extenddigital.cl/archivos/equipo/j_villar.jpg', '', '', 0, 1, 0, '', '', '', 'https://www.linkedin.com/in/jos%C3%A9-ignacio-villar-ag%C3%BCero-068148122/?ppe=1', '2017-09-20 10:30:54', '2018-07-26 12:32:50', 'fran', 'fran', 'jvillar@thehouse.cl', 'Consultor', 'http://thehouse.extenddigital.cl/archivos/equipo/j_villar2.jpg'),
(47, 'JUAN IGNACIO CASTRO', 'juan-ignacio-castro', 'Ingeniero Civil Industrial Pontificia Universidad Católica de Chile', '<ul><li>Juan Ignacio es Consultor en The<strong>House</strong> y ha trabajado en proyectos de investigación y desarrollo, gestión y desarrollo de talento y gestión del cambio en la industria de minería y energías renovables. Adicionalmente, ha sido colaborador y voluntario en diversos proyectos sociales: Proyecta UC, Belén UC, Co-Emprende, entre otros.</li><br><li>Antes de entrar a The<strong>House</strong>, Juan Ignacio trabajó como Ingeniero de proyectos en Servicios de Energía Ciudad Luz SpA.</li><br><li>Juan Ignacio es Ingeniero Civil Industrial de la Pontificia Universidad Católica de Chile con mención en Ingeniería Eléctrica.</li></ul>', 'http://thehouse.extenddigital.cl/archivos/equipo/jcastro.jpg', '', '', 0, 1, 0, '', '', '', 'https://www.linkedin.com/in/juan-ignacio-castro-105567133/?ppe=1', '2017-09-20 10:44:22', '2018-07-26 12:27:45', 'fran', 'fran', 'jcastro@thehouse.cl', 'Consultor', 'http://thehouse.extenddigital.cl/archivos/equipo/jcastro_2.jpg'),
(48, 'MARIANA HERNÁNDEZ', 'mariana-hernandez', 'Ingeniero Comercial Pontificia Universidad Católica de Chile', '<ul><li>Mariana es Consultor en The<strong>House</strong> y ha trabajado en proyectos de optimización de procesos, mejora continua y gestión del cambio en minería y finanzas.</li><br><li>Antes de entrar a The<strong>House</strong>, Mariana trabajó como Brand Manager en Arauco Nutrientes Naturales SpA. Previo a esto, realizó prácticas profesionales como Analista de Marketing, Procurement, Customer Services en NYK Sudamérica (Chile) Ltda. Representó a Chile en la competencia internacional de casos Brasil Case Competition en Sao Paulo, y participó activamente en diversas actividades universitarias destacando el Festival Internacional de Innovación Social de San Joaquín. Adicionalmente, se desempeñó como ayudante de los ramos Probabilidades y Métodos de Optimización.</li><br><li>Mariana es Ingeniero Comercial de la Pontificia Universidad Católica de Chile, titulada con dos votos de distinción.</li></ul>', 'http://thehouse.extenddigital.cl/archivos/equipo/m_hernandez.jpg', '', '', 0, 1, 0, '', '', '', 'https://www.linkedin.com/in/mariana-hern%C3%A1ndez-eyquem-652774112/', '2017-11-23 09:56:42', '2018-07-26 12:32:27', 'fran', 'fran', 'mhernandez@thehouse.cl', 'Consultor', 'http://thehouse.extenddigital.cl/archivos/equipo/m_hernandez2.jpg'),
(49, 'DANIEL COELHO', 'daniel-coelho', 'Ingeniero Civil Industrial Ecole National SupÃ©rieures dâArts et MÃ©tiers', '<br><div><br></div><ul><li>Ex Senior âImplementation&nbsp;Coach&nbsp;Latamâ en&nbsp;Mckinsey&nbsp;&amp; Company&nbsp;</li><li>Experiencia\r\noperacional y de administraciÃ³n de proyectos como Director de Operaciones para\r\nAlstom Transport en\r\nChile</li><li>Experiencia\r\nen desarrollo comercial internacional como âBusiness Development\r\nDirectorâ en Alstom Transport, y\r\nâBusiness Development\r\nManagerâ para amÃ©rica latina en Pomagalsky</li></ul><br><ul><li><strong>Ingeniero\r\nCivil Industrial</strong></li></ul><span style=\"white-space:pre\">  </span>Ecole National SupÃ©rieures dâArts et MÃ©tiers&nbsp;<br><ul><li><strong>Master\r\nof Management &amp; Industrial Engineering</strong></li></ul><span style=\"white-space:pre\">  </span>Asian Institute of Technology&nbsp;<br><br><p style=\"margin-top:0pt;margin-bottom:0pt;margin-left:0in;direction:ltr;unicode-bidi:embed\"><span style=\"font-size:18pt;font-family:\'Lucida Sans Unicode\'\"></span></p>\r\n<p>Daniel tiene amplia experiencia liderando transformaciones organizacionales, operativas y estratÃ©gicas para empresas de minerÃ­a, silvicultura,&nbsp;&nbsp;retail&nbsp;y servicios con resultados de alto impacto.<br></p>', 'http://thehouse.extenddigital.cl/archivos/equipo/DC.jpg', '', '', 0, 0, 0, '', '', '', 'https://www.linkedin.com/in/danielcoelho/', '2018-04-06 14:06:35', '2018-06-29 14:29:37', 'fran', 'fran', 'dcoelho@thehouse.cl', 'Director de Proyectos', 'http://thehouse.extenddigital.cl/archivos/equipo/DC1.jpg'),
(50, 'PATRICIA GRABER', 'patricia-graber', 'Ingeniero Comercial Universidad Adolfo Ibáñez', '<ul><li>Patricia es Consultor Senior en The<strong>House</strong> y ha trabajado en proyectos de diseño organizacional, eficiencia, compensación fija y variable, gestión del desempeño y gestión por competencias en industrias tales como tecnología, consumo masivo, bancos, energía y construcción.</li><br><li>Antes de entrar a The<strong>House</strong>, Patricia trabajó como Consultor Senior DO en Sentier Consulting. Previo a esto, trabajó como Consultor DO y Compensaciones en Korn Ferry - Hay Group incluyendo consultoría a nivel internacional (Perú, Brasil y Argentina), y trabajó como Investigadora de Economía Internacional en la Fundación Libertad y Desarrollo.</li><br><li>Patricia es Ingeniero Comercial de la Universidad Adolfo Ibáñez y tiene un Master en Economía y Políticas Públicas en la misma universidad.</li></ul>', 'http://thehouse.extenddigital.cl/archivos/equipo/p_graber.jpg', '', '', 0, 1, 0, '', '', '', 'https://www.linkedin.com/in/patriciagraber2017/', '2018-04-06 14:20:53', '2018-07-26 12:25:20', 'fran', 'fran', 'pgraber@thehouse.cl', 'Consultor Senior', 'http://thehouse.extenddigital.cl/archivos/equipo/p_graber2.jpg'),
(51, 'ALEJANDRA SOTO', 'alejandra-soto', 'Ingeniero Civil Industrial Universidad de Concepción', '<ul><li>Alejandra es Consultora Senior y ha trabajado en proyectos de consultoría en el sector público e industrias de telecomunicaciones y minería, así como en áreas de estrategia y control corporativo en negocio de telecomunicaciones, banca, productos financieros y cajas de compensación. Adicionalmente, ha sido mentora del programa Pyme UC.</li><br><li>Antes de entrar a The<strong>House</strong>, Alejandra fue Subgerente de Planificación y Control de Gestión en La Araucana CCAF. Previo a esto, trabajó como Consultora de Estudios y Proyectos Estratégicos en Telefónica Chile y como Consultora de proyectos del área Business Consulting en Everis Chile.</li><br><li>Alejandra es Ingeniero Civil Industrial en la Universidad de Concepción y posee un MBA en la Pontificia Universidad Católica de Chile y un Diplomado en Planificación y Control Financiero en la Universidad de Chile.</li></ul>', 'http://thehouse.extenddigital.cl/archivos/equipo/a_soto.jpg', '', '', 0, 1, 0, '', '', '', 'https://www.linkedin.com/in/asotom/', '2018-06-19 12:52:54', '2018-07-26 12:28:50', 'fran', 'fran', 'asoto@thehouse.cl', 'Consultor Senior', 'http://thehouse.extenddigital.cl/archivos/equipo/a_soto2.jpg'),
(52, 'OLIVIA SÁNCHEZ', 'olivia-sanchez', 'Ingeniero Civil Industrial Pontificia Universidad Católica de Chile', '<ul><li>Olivia es Consultor en The<strong>House</strong> y ha trabajado en proyectos de alineamiento estratégico en minería, optimización de procesos y evaluación de proyectos en la industria del plástico.</li><br><li>Antes de entrar a The<strong>House</strong>, Olivia trabajó como Analista de Control de Gestión en Wenco S.A. en la Gerencia de Desarrollo de Nuevos Negocios. Previo a esto, realizó su práctica profesional como Ingeniero de Estudios en MAS Recursos Naturales S.A. Adicionalmente, fue colaboradora y voluntaria del programa Ingenieros UC Desafiando Fronteras.</li><br><li>Olivia es Ingeniero Civil Industrial de la Pontificia Universidad Católica de Chile con mención en Mecánica, titulada con distinción máxima.</li></ul>', 'http://thehouse.extenddigital.cl/archivos/equipo/o_sanchez.jpg', '', '', 0, 1, 0, '', '', '', 'https://www.linkedin.com/in/olivia-sanchez-ocaranza-8a104262/', '2018-06-19 13:09:33', '2018-07-26 12:28:16', 'fran', 'fran', 'osanchez@thehouse.cl', 'Consultor', 'http://thehouse.extenddigital.cl/archivos/equipo/o_sanchez2.jpg'),
(53, 'MARIA FERNANDA LE BRETON', 'maria-fernanda-le-breton', 'T&eacute;cnico en administraci&oacute;n de empresa Centro Educacional Baldomero Lillo', '<ul><li>María Fernanda es Asistente Contable en The<strong>House</strong> y ha trabajado en el área de abastecimiento y administración en la industria de refrigeración industrial.</li><br><li>Antes de entrar a The<strong>House</strong>, María Fernanda trabajó 5 años como Asistente Contable en las empresas Frigorent SpA y INRA Refrigeración Industrial SpA.</li><br><li>María Fernanda posee un título Técnico en administración de empresa en el Centro Educacional Baldomero Lillo y es Estudiante de contabilidad y auditoría en la Escuela de contadores auditores de Santiago.</li></ul>', 'http://thehouse.extenddigital.cl/archivos/equipo/f_lebreton.jpg', '', '', 0, 1, 0, '', '', '', '', '2018-06-19 13:31:31', '2018-07-27 11:45:24', 'fran', 'fran', 'mlebreton@thehouse.cl', 'Asistente Contable', 'http://thehouse.extenddigital.cl/archivos/equipo/f_lebreton2.jpg'),
(54, 'FRANCISCO HAMILTON', 'francisco-hamilton', 'Ingeniero Civil Industrial Pontificia Universidad Católica de Chile', '<ul><li>Francisco es Consultor Senior en The<strong>House</strong> y ha liderado proyectos de Planificación e Implementación estratégica, Change Management y Gestión y Eficiencia en Transportes en industrias tales cómo consumo masivo, retail, ecommerce, cementos, minería y con el Gobierno Británico, tanto en Chile, Latinoamérica y UK.</li><br><li>Antes de entrar a The<strong>House</strong>, Francisco trabajó por más de 4 años como consultor en Integration Consulting. Previo a esto, trabajó en Evaluación de Proyectos de Innovación en la Corporación de Fomento Productivo de Chile (CORFO) y cómo Coordinador de Emprendimiento en Fundación Proyecto B.</li><br><li>Francisco es Ingeniero Civil Industrial de la Pontificia Universidad Católica de Chile y realizó un intercambio académico en la University of New South Wales, Sydney, Australia.</li></ul>', 'http://thehouse.extenddigital.cl/archivos/equipo/Francisco%20Hamilton%201.jpg', '', '', 0, 1, 0, '', '', '', '', '2018-08-23 13:22:38', '2018-08-23 13:23:19', 'fran', 'fran', 'fhamilton@thehouse.cl', 'Consultor Senior', 'http://thehouse.extenddigital.cl/archivos/equipo/Francisco%20Hamilton%202.jpg'),
(55, 'ENRIQUE BRAVO', 'enrique-bravo', 'Ingeniero Civil Pontificia Universidad Católica de Chile', '<ul><li>Enrique es Consultor Senior en The<strong>House</strong> y ha liderado proyectos de optimización de procesos y estrategia operativa con probados resultados en las áreas productivas y logísticas en industrias de consumo masivo, retail y procesos productivos.</li><br><li>Antes de entrar a The<strong>House</strong>, Enrique trabajó por más de 2 años como Gerente de Proyectos en Terrenal Consultores. Previo a esto, Enrique desempeñó diversos cargos en empresas de consumo masivo, primero con 4 años de experiencia en la Gerencia Logística de Coca Cola Andina Chile, llegando a ocupar el cargo de Sub Gerente de Distribución Nacional, y posteriormente 2 años como Sub Gerente Industrial de la franquicia americana Papa John’s en Chile.</li><br><li>Enrique es Ingeniero Civil con mención en Ingeniería y Gestión de la Construcción de la Pontificia Universidad Católica de Chile.</li></ul>', 'http://thehouse.extenddigital.cl/archivos/equipo/Enrique%20Bravo%201.jpg', '', '', 0, 1, 0, '', '', '', '', '2018-08-23 15:36:44', NULL, 'fran', NULL, 'ebravo@thehouse.cl', 'Consultor Senior', 'http://thehouse.extenddigital.cl/archivos/equipo/Enrique%20Bravo%202.jpg');

