(18, '¿Qui&eacute;nes somos?', '?quieacutenes-somos', 'ConsultorÃ­a en alta direcciÃ³n y capacidades organizacionales con un fuerte foco en los resultados', '<br>\r\nSomos una firma de consultoría en alta dirección y capacidades organizacionales. Nuestro foco es asesorar a compañías en el diseño estratégico, estructura de organización y desarrollo de equipos para que puedan lograr sus resultados de manera exitosa y eficiente.', '<div class=\"w-col ajuste\" style=\"text-align:center\">\r\n<h2 class=\"blog-text date\" style=\"text-align:left\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;PROYECTOS EN LOS QUE HEMOS TRABAJADO POR INDUSTRIA</h2>\r\n                        <img src=\"http://thehouse.extenddigital.cl/archivos/nosotros/industrias.png\">\r\n                    </div>', 'http://www.thehouse.cl/es/archivos/nosotros/quienes%20somos.png', '', '', 1, 1, 0, '', '', '', '', '2015-03-20 09:54:19', '2018-08-06 18:27:14', 'admin', 'fran', 'http://thehouse.extenddigital.cl/archivos/iconos/quienes_somos.png'),
(19, '¿Qu&eacute; hacemos?', '?queacute-hacemos', 'Generamos cambios integralmente con nuestros clientes y sus equipos', '<br>\r\nApoyamos a grandes empresas y organizaciones sin fines de lucro a enfrentar sus desafíos estratégicos y organizacionales, a través de un equipo de excelencia, una metodología que se ajusta a la realidad del cliente, una solución a la medida y un proceso cercano.', '<h2 class=\"blog-text date\" style=\"text-align:center;color:#ffffff\">NUESTROS CLIENTES HABLAN DE NOSOTROS</h2><br><br><br>\r\n<div class=\"w-col w-col-6 ajuste\">\r\n<ul>\r\n    <li><em style=\"color:#ffffff\">“The<strong style=\"color:#fff\">House</strong> tiene credibilidad, transparencia y confidencialidad, atributos no fáciles de encontrar”.</em><br><p style=\"text-align:right;color:#00afaa\">Jorge Gómez<br> Presidente Ejecutivo Collahuasi</p>\r\n</li>\r\n<div><br></div>\r\n<li><em style=\"color:#ffffff\">“The<strong style=\"color:#fff\">House</strong> nos ayudó a diseñar una estrategia robusta, consistente con nuestro modelo de negocios y con la realidad y contexto competitivo de nuestra industria, y a identificar las acciones estratégicas concretas a desarrollar y gestionar de manera flexible”. </em><br><p style=\"text-align:right;color:#00afaa\">Julio Bertrand<br> Gerente General Empresas Gasco</p></li>\r\n</ul>\r\n</div>  \r\n<div class=\"w-col w-col-6 ajuste\">\r\n<ul>\r\n<li><em style=\"color:#ffffff\">“En The<strong style=\"color:#fff\">House</strong> encontramos a alguien que se adapta. Son capaces de mirar los temas desde arriba y los detalles a la vez, para que cumplamos lo que nos proponemos. Tienen socios presentes que son complementarios, además de consultores exhaustivos, con metodología y que se atreven a decir lo que piensan”. </em><br><p style=\"text-align:right;color:#00afaa\">Franco Bozzalla <br> Vicepresidente Negocio Celulosa y Energía Arauco</p></li>\r\n<br>\r\n<li><em style=\"color:#ffffff\">“En The<strong style=\"color:#fff\">House</strong> se adaptan, son flexibles y van construyendo contigo”.</em><br><p style=\"text-align:right;color:#00afaa\">María Olivia Recart <br> Vicepresidenta de Asuntos Corporativos <br>para Las Américas de BHP Billiton</p></li>\r\n</ul>\r\n</div>', 'http://www.thehouse.cl/es/archivos/nosotros/razon.png', '', '', 2, 1, 0, '', '', '', '', '2015-03-20 09:55:34', '2018-08-07 10:33:25', 'admin', 'fran', 'http://thehouse.extenddigital.cl/archivos/iconos/que_hacemos.png'),
(20, '¿Qu&eacute; caracteriza nuestro equipo?', '?queacute-caracteriza-nuestro-equipo', 'Generamos cambios integralmente con nuestros clientes y sus equipos', 'Tenemos un equipo integral. Somos personas de excelencia, con espíritu de equipo, pasión y empatía tanto con nuestros clientes como en la empresa misma. Tenemos flexibilidad para adaptarnos a las necesidades del momento y, por sobre todo, buscamos aportar para hacer un cambio en la sociedad.', '<div class=\"w-col\" style=\"text-align:center\">\r\n <p class=\"izquierda blog-text date\" style=\"text-align:center\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Organizaciones sin fines de lucro a las que hemos asesorado</p>\r\n                        <img src=\"http://thehouse.extenddigital.cl/archivos/nosotros/SINFINESDELUCRO.png\">\r\n                    </div>', 'http://www.thehouse.cl/es/archivos/images/nosotros/pv.png', '', '', 3, 1, 0, '', '', '', '', '2015-03-20 09:56:34', '2018-08-06 19:05:39', 'admin', 'fran', 'http://thehouse.extenddigital.cl/archivos/iconos/4home.png'),
(21, '¿Cu&aacute;l es nuestro prop&oacute;sito?', 'NUESTRA HISTORIA', '<br>\r\n  The<strong style=\"color:#FFF;\">House</strong> partió en 2014, cuando un grupo de personas decidió crear una consultora que influyera y aportara a la sociedad. Buscábamos que las empresas fueran más efectivas, para crear un mundo mejor. También queríamos formar a profesionales integrales, que ejercieran un liderazgo inspirador para construir una mejor sociedad. Hoy somos un grupo de casi 30 personas que ha trabajado en más de 70 proyectos con grandes empresas de diversas industrias.', 'Creemos que las empresas tienen la responsabilidad de construir una mejor sociedad, que siempre es posible hacer las cosas mejor, que la efectividad organizacional es sinérgica con la realización de los equipos y aspiramos a que estos se comprometan con la estrategia.', 'pruieba  <div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div><br></div><div>prueba2</div>', '', '', '', 4, 1, 0, '', '', '', '', '0000-00-00 00:00:00', '2018-10-11 10:51:05', '', 'fran', 'http://thehouse.extenddigital.cl/archivos/iconos/proposito.png');

