(3, 'Proyecto la batalla norte y sur', 'proyecto-la-batalla-norte-y-sur', 'Zapallar norte y sur', 'Exclusivo loteo, inmejorable ubicaciÃ³n. Propiedades de 3 dormitorios y 2 baÃ±os. 540 m2 construidos 2700 terreno.<br><strong><br>Desde: uf 65.000<br>Proceso: terminado  </strong>', 'http://www.thehouse.cl/es/archivos/propiedades/casa2.jpg', '', '', 0, 1, 0, '', '', '', '', '2015-01-12 12:18:25', '2015-01-27 12:59:12', 'admin', 'admin', '', '', '0000-00-00'),
(4, 'Proyecto vista quelhue', 'proyecto-vista-quelhue', 'vista quelhue Hacienda puerto pucÃ³n', 'Exclusivo loteo, inmejorable ubicaciÃ³n en sector con alta plusvalÃ­a. <br><br><strong>Sitios 1000 m2 urbanizados con vista al volcÃ¡n y las montaÃ±as.  </strong>', 'http://www.thehouse.cl/es/archivos/propiedades/portfolio-4.jpg', '', '', 0, 1, 0, '', '', '', '', '2015-01-12 12:19:27', '2015-01-30 13:15:59', 'admin', 'admin', 'quehuel', 'Terminado', '2017-03-30'),
(5, 'Proyecto la Nueva Paragonia', 'proyecto-la-nueva-paragonia', 'Los filtros de cruce son una clase de filtro electrÃ³nico utilizado en aplicaciones de audio.', '<p>Un filtro de cruce es un circuito divisor de frecuencias. Se trata de un dispositivo capaz de filtrar las frecuencias a la entrada, para obtener a la salida una determinada banda de frecuencias. El margen que ocupe esta banda dependerÃ¡ de la configuraciÃ³n del propio sistema. Se trata de una red divisora de frecuencias, es decir, separa la seÃ±al procedente de una fuente de sonido en \"franjas\" de frecuencias (altas, altas-medias, medias, bajas, etc). En audio se utilizan dos tipos de crossovers: los Activos que dividen la seÃ±al antes de ser amplificada y los Pasivos que la dividen despuÃ©s de ser amplificadas (salida a los altavoces).</p><p>Existen varios tipos de filtros de cruce en acÃºstica, pero por lo general pertenecen a una de las siguientes clases.</p>', 'http://www.thehouse.cl/es/archivos/propiedades/portfolio-4.jpg', '', '', 0, 1, 0, '', '', '', '', '2015-01-27 13:01:59', '2015-01-27 15:36:44', 'admin', 'admin', 'paragonia', 'Verde', '0000-00-00'),
(6, 'Proyecto Tower', 'proyecto-tower', 'Â¿QuÃ© deseas? Fortuna? Gloria? Poder? Venganza? o informaciÃ³n sobre la Torre.', '<p>La&nbsp;<strong>Torre de Babel</strong>&nbsp;(en&nbsp;<a href=\"http://es.wikipedia.org/wiki/Idioma_hebreo\" title=\"Idioma hebreo\">hebreo</a>:&nbsp;×××× ×××â&nbsp;<em>Migdal Babel</em>; y en&nbsp;<a href=\"http://es.wikipedia.org/wiki/Griego_antiguo\" title=\"Griego antiguo\">griego antiguo</a>&nbsp;Î ÏÏÎ³Î¿Ï Ïá¿Ï ÎÎ±Î²Î­Î»,&nbsp;<em>Pirgos tÄs Babel</em>) era una significativa edificaciÃ³n mencionada en el judeocristiano, que fue construida por los hombres en tiempos inmemoriales y que fehacientemente se lo puede identificar con el histÃ³rico zigurat&nbsp;<a href=\"http://es.wikipedia.org/wiki/Etemenanki\" title=\"Etemenanki\">Etemenanki</a>&nbsp;de la antigua ciudad de Babilonia.<sup>[<em><a href=\"http://es.wikipedia.org/wiki/Wikipedia:Verificabilidad\" title=\"Wikipedia:Verificabilidad\">cita&nbsp;requerida</a></em>]</sup>&nbsp;Este edificio, en cuya cÃºspide estaba la&nbsp;<a href=\"http://es.wikipedia.org/wiki/Esagila\" title=\"Esagila\">Esagila</a>&nbsp;-templo dedicado a&nbsp;<a href=\"http://es.wikipedia.org/wiki/Marduk\" title=\"Marduk\">Marduk</a>-, originalmente tenÃ­a siete pisos de altura y mÃ¡s de 91 metros, pero pocos de sus restos permanecen en la actualidad.</p><p>La Torre de Babel no solo es una edificaciÃ³n clave en la tradiciÃ³n judeocristiana y mencionada en el antiguo Testamento, sino tambiÃ©n pertenece al ideario universal y su historia ha trascendido generaciones. Pero la leyenda de la torre reposa sobre una realidad, pues existÃ­a en efecto en Babilonia una construcciÃ³n de varios pisos y de origen desconocido, que era ya restaurada en tiempos de Nabopolasar (625-605 AC), fundador de la dinastÃ­a caldea.</p><p>Inclusive, esta construcciÃ³n se llamaba&nbsp;<a href=\"http://es.wikipedia.org/wiki/Etemenanki\" title=\"Etemenanki\">Etemenanki</a>, que puede ser interpretado como Â«la mansiÃ³n de lo alto entre el cielo y la tierraÂ», concordando con las principales interpretaciones del capÃ­tulo 11 del&nbsp;<em><a href=\"http://es.wikipedia.org/wiki/G%C3%A9nesis\" title=\"GÃ©nesis\">GÃ©nesis</a></em>que afirman sobre la construcciÃ³n de la torre, que los hombres pretendÃ­an alcanzar el&nbsp;<em><a href=\"http://es.wikipedia.org/wiki/Cielo_(religi%C3%B3n)\" title=\"Cielo (religiÃ³n)\">Cielo</a></em>. Una inscripciÃ³n que data del tiempo de Nabopolasar seÃ±ala: \"Marduk (el gran dios de Babilonia) me ha ordenado colocar sÃ³lidamente las bases de la&nbsp;<a href=\"http://es.wikipedia.org/wiki/Etemenanki\" title=\"Etemenanki\">Etemenanki</a>&nbsp;hasta alcanzar el mundo subterrÃ¡neo y hacer de este modo que su cÃºspide llegue hasta el cielo\". En otra inscripciÃ³n, de los tiempos de Nabucodonosor, se precisa que la decoraciÃ³n de la cÃºspide estaba hecha de \"ladrillos de esmalte azul brillante, es decir, adornada del color del cielo, perfectamente adaptado para dar la impresiÃ³n de que el edificio se perdÃ­a en el azul infinito.</p>', 'http://www.thehouse.cl/es/archivos/propiedades/portfolio-3.jpg', '', '', 0, 1, 0, '', '', '', '', '2015-01-27 13:30:24', '2015-01-30 18:35:53', 'admin', 'admin', 'tower', '', '2006-06-06'),
(7, 'Esfinge', 'esfinge', 'Tenga en cuenta que la CSS para estos diseÃ±os cuenta con numerosos comentarios. Si realiza la mayor', 'Tenga en cuenta que la CSS para estos diseÃ±os cuenta con numerosos comentarios. Si realiza la mayor parte de su trabajo en la vista DiseÃ±o, eche un vistazo al cÃ³digo para obtener sugerencias sobre cÃ³mo trabajar con la CSS para diseÃ±os fijos. Puede quitar estos comentarios antes de lanzar el Tenga en cuenta que la CSS para estos diseÃ±os cuenta con numerosos comentarios. Si realiza la mayor parte de su trabajo en la vista DiseÃ±o, eche un vistazo al cÃ³digo para obtener sugerencias sobre cÃ³mo trabajar con la CSS para diseÃ±os fijos. Puede quitar estos comentarios antes de lanzar el', 'http://www.thehouse.cl/es/archivos/propiedades/casa2.jpg', '', '', 0, 1, 0, '', '', '', '', '2015-01-27 15:44:07', '2015-01-30 13:16:20', 'admin', 'admin', 'esfinge', 'Terminado', '2015-02-26'),
(8, 'Prueba de fecha para el ingreso de un proyecto', 'prueba-de-fecha-para-el-ingreso-de-un-proyecto', 'Lo siguiente es una prueba', 'Esta prueba es con el fin de poder confirmar de manera exitosa que se realize correctamente la insercion del date en el proyecto', 'http://www.thehouse.cl/es/archivos/propiedades/casa2.jpg', '', '', 0, 1, 0, '', '', '', '', '2015-01-30 12:28:45', NULL, 'admin', NULL, 'prueba', 'Verde', '2015-02-01');

