INSERT INTO `tbl_servicios` (`id`, `titulo`, `alias`, `intro`, `descripcion`, `imagen`, `imagen_interior`, `enlace`, `target`, `posicion`, `estado`, `destacado`, `meta_titulo`, `meta_descripcion`, `meta_tag`, `redes`, `fecha_ingreso`, `fecha_actualizacion`, `creador`, `modificador`, `tipo_servicio`) VALUES
(18, 'Sistema Organizacional', 'sistema-organizacional', '', '<div class=\"w-col w-col-6 column\">\r\n        <p class=\"izquierda blog-text date2\">Sistema organizacional</p>\r\n        <br><br><ul>\r\n          <li><strong style=\"color:#ffffff\">Estructura organizacional:</strong> Diseñar una estructura efectiva y alineada a los objetivos estratégicos, que permita obtener el máximo potencial del negocio.<br>\r\n            <br>\r\n          </li>\r\n          <li><strong style=\"color:#ffffff\">Sistema de gobierno:</strong> Diseñar un sistema que asegure la efectividad y agilidad en la toma de decisiones, otorgando equilibrio entre la autonomía y el control necesarios para el negocio.<br>\r\n            <br>\r\n          </li>\r\n          <li><strong style=\"color:#ffffff\">Procesos y políticas de RRHH: </strong>Diseñar los principales procesos y políticas de gestión de personas, de manera de otorgar sustentabilidad a la estructura definida y apoyar el cumplimiento de los objetivos del negocio.</li><br>\r\n            <li><strong style=\"color:#ffffff\">Sistemas de incentivos: </strong>Diseñar un esquema de incentivos que permita alinear al equipo a las metas del negocio, promoviendo los comportamientos y el estilo de liderazgo requeridos, y facilitando al mismo tiempo el desarrollo y la retención del talento. </li>\r\n        </ul>\r\n        <br>\r\n      </div>  \r\n<div class=\"w-col w-col-6 column ajuste\"><br><br> &nbsp; &nbsp; &nbsp; &nbsp;<img src=\"http://thehouse.extenddigital.cl/archivos/servicios/org.png\">\r\n</div>', '', '', '', '', 2, 1, 0, '', '', '', '', '2015-03-20 10:03:54', '2018-08-07 09:41:55', 'admin', 'fran', 'Desarrollo de equipos ejecutivos'),
(19, 'Desarrollo de Equipos ejecutivos', 'desarrollo-de-equipos-ejecutivos', '', '<p class=\"blog-text date\">Desarrollo de equipos ejecutivos</p><br><br><br><br>\r\n                <div class=\"w-col w-col-4 ajuste\">\r\n                    <img src=\"images/333.jpg\" class=\"img-responsive\" alt=\"54a01a2043675e7e54f0597b_333.jpg\">\r\n                    <br><h4 class=\"tittle _2\">Alineamiento estratégico</h4><br>\r\n                    <p class=\"blog-text _2 style justificado\">Alinear al equipo ejecutivo hacia una orientación a la estrategia del negocio, de manera de potenciar los resultados. </p></div>\r\n                    <div class=\"w-col w-col-4 ajuste\">\r\n                    <img src=\"images/111.jpg\" class=\"img-responsive\" alt=\"54a01a2a9f6345da4525dde4_111.jpg\">\r\n                    <br><h4 class=\"tittle _2\">Desarrollo de liderazgo</h4><br>\r\n                    <p class=\"blog-text _2 style justificado\">Potenciar a los líderes de la organización para que conduzcan a sus equipos y generen acciones que potencien la estrategia. </p>\r\n                </div>\r\n                    <div class=\"w-col w-col-4 ajuste\">\r\n                    <img src=\"images/222.jpg\" class=\"img-responsive\" alt=\"54a01a0f43675e7e54f05979_222.jpg\">\r\n                    <br><h4 class=\"tittle _2\">Equipos de alto desempeño </h4><br>\r\n                    <p class=\"blog-text _2 style justificado\">Potenciar la capacidad del equipo ejecutivo de manera de habilitar la estrategia y lograr la máxima efectividad. </p>\r\n                </div>', '', '', '', '', 3, 1, 0, '', '', '', '', '2015-03-20 10:07:38', '2018-08-07 09:45:14', 'admin', 'fran', 'Desarrollo de equipos ejecutivos'),
(20, 'Gesti&oacute;n del cambio', 'gestioacuten-del-cambio', '', '<div class=\"w-col w-col-5 column\">\r\n<img src=\"http://thehouse.extenddigital.cl/archivos/servicios/transf2.png\">\r\n</div>\r\n<div class=\"w-col w-col-1 column\">\r\n</div>\r\n<div class=\"w-col w-col-6 column ajuste\">\r\n<p class=\"izquierda blog-text date2\">Gestión del cambio</p><br><br><br>\r\n<ul>\r\n          <li> <strong style=\"color:#ffffff\">Transformación organizacional: </strong>Redefinir el sistema organizacional para potenciar de mejor manera los objetivos estratégicos y rediseñar los procesos de negocio, estructuras, y sistemas de gestión.<br>\r\n          </li><br>\r\n          <li><strong style=\"color:#ffffff\">Transformación cultural: </strong>Apoyar el cambio de la cultura de una organización, abarcando temas de alineamiento estratégico, propósito, sentido organizacional, procesos de personas, comunicación organizacional, liderazgo y cultura.<br><br>\r\n          </li>\r\n          <!--<li> <strong style=\"color:#ffffff\">IntegraciÃ³n cultural: </strong>Este proceso considera la integraciÃ³n de una o  varias culturas que puedan existir dentro de una organizaciÃ³n. Se establecen la  lÃ­nea base y los lineamientos para una Ãºnica cultura organizacional para luego  trabajar en la transformaciÃ³n cultural<br>\r\n          </li><br>-->\r\n          <li> <strong style=\"color:#ffffff\">Comunicación estratégica:  </strong>Gestionar los flujos de información ascendente, descendente y horizontal para asegurar la calidad, temporalidad y respuesta de los equipos con el objetivo de lograr que el mandato estratégico llegue a toda la organización en forma oportuna. \r\n</li>\r\n        </ul>\r\n        <br>\r\n      </div>', '', '', '', '', 4, 1, 0, '', '', '', '', '2015-03-20 14:32:47', '2018-08-07 09:46:46', 'admin', 'fran', 'Desarrollo de equipos ejecutivos'),
(21, 'Estrategia', 'estrategia', '', '<div class=\"w-col w-col-5 column\"><img src=\"http://thehouse.extenddigital.cl/archivos/estrategia/estrategia_way.png\"></div>\r\n<div class=\"w-col w-col-1 column\"> </div>\r\n<div class=\"w-col w-col-6 column ajuste\">\r\n<br>\r\n<br>\r\n <p class=\"izquierda blog-text date\">Estrategia</p><br><br><br><ul>\r\n    <li>\r\n      <p><strong>Planificación estratégica:&nbsp;</strong>Generar un proceso que permita a la empresa acordar sus definiciones estratégicas a corto, mediano y largo plazo. Todo esto, consensuando el propósito, campos de acción, objetivos e iniciativas estratégicas. <br>\r\n        <br>\r\n      </p>\r\n    </li>\r\n    <li>\r\n      <p><strong>Estrategia de crecimiento:&nbsp;</strong>Identificar el negocio base y su robustez, analizando dimensiones internas (organización y equipo) y externas (industria). Evaluar la posibilidad de crecimiento y expandir el modelo hacia más allá de su negocio base.\r\n<br>\r\n        <br>\r\n      </p>\r\n    </li>\r\n    <li>\r\n      <p><strong>Productividad y eficiencia:</strong>&nbsp;Instalar en la empresa un programa desafiante que permita mejorar los indicadores de productividad y eficiencia.\r\n<br>\r\n        <br>\r\n      </p>\r\n    </li>\r\n    <li>\r\n      <p><strong>Estrategia corporativa:</strong>&nbsp;Definir una estrategia alineada con las unidades de negocio e identificar el rol del holding acorde a la estrategia acordada.\r\n<br>\r\n        <br>\r\n    </p></li>\r\n    <!--<li><p><strong>Planificaci&oacute;n y control de gesti&oacute;n:</strong> Desarrollar Balanced Score Card que permita definir el mapa estrat&eacute;gico, KPIs y metas para la\r\n      perspectiva financiera, cliente, procesos y equipo\r\n      <br></p>\r\n    </li>-->\r\n  </ul>\r\n<br>\r\n</div>', '', 'http://thehouse.extenddigital.cl/es/archivos/estrategia/corsshair.png', '', '', 1, 1, 0, '', '', '', '', '2015-03-30 15:33:40', '2018-08-07 09:40:57', 'admin', 'fran', 'Desarrollo de equipos ejecutivos');

