(9, 'APRENDER DE CONSULTORÃA - BENEFICIOS QUE VEMOS PARA TI', 'aprender-de-consultora', '', '<br><br><br>\r\n<div class=\"w-col w-col-6 column-media2 process derecha\">\r\n                    <div ix=\"features\" class=\"service-icon\" style=\"opacity:1;transform:scale(1);display:block;transition:opacity 500ms ease 0s, transform 700ms ease 0s\">\r\n                      <img alt=\"54900eb1c90c642d373e731f_retina.svg\" src=\"images/u5.png\">\r\n                    </div>\r\n                    <p class=\"izquierda blog-text date\">Aprender de  consultorÃ­a</p><br>\r\n                    <ul>\r\n                        <li class=\"justificar\"> Asesoramos a nuestros clientes cuando no cuenta con la experiencia requerida y nuestra propuesta de valor es contar con experiencia en situaciones similares</li>\r\n                        <li class=\"justificar\">Es un apoyo orientado a los lÃ­deres de las grandes empresas, cuando:</li>\r\n                        <ul style=\"padding-left:30px\"><li class=\"justificar\">No existe claridad sobre que decisiÃ³n tomar o quÃ© curso de acciÃ³n seguir</li>\r\n                        <li class=\"justificar\">Existe claridad, pero no es posible implementar una decisiÃ³n por falta de recursos o expertise</li></ul>\r\n                    </ul><br><br>\r\n                </div>\r\n<div class=\"w-col w-col-5 col-sm-offset-1 column-media2 process derecha\">\r\n                     <div ix=\"features\" class=\"service-icon\" style=\"opacity:1;transform:scale(1);display:block;transition:opacity 500ms ease 0s, transform 700ms ease 0s\">\r\n                      <img alt=\"54900eb1c90c642d373e731f_retina.svg\" src=\"images/u6.png\">\r\n                    </div>\r\n                    <p class=\"izquierda blog-text date\">BENEFICIOS QUE VEMOS PARA TI</p><br>\r\n                        <ul>\r\n                            <li class=\"justificar\">Desarrollo y Aprendizaje Acelerado, dada la diversidad de proyectos de los que podrÃ¡s participar</li>\r\n                            <li class=\"justificar\">TrabajarÃ¡s codo a codo con los Socios en un ambiente altamente desafiante y colaborativo, enfocado en lograr con Ã©xito sus desafÃ­os</li>\r\n                            <li class=\"justificar\">ApoyarÃ¡s a importantes Gerentes de alto nivel en distintas industrias</li>\r\n                            <li class=\"justificar\">PodrÃ¡s Ampliar tus redes de contacto</li>\r\n                        </ul>\r\n                 </div>', '', '', '', 1, 0, 0, '', '', '', '', '2015-03-20 14:40:02', '2018-07-17 09:14:25', 'admin', 'fran'),
(11, 'FORMAR PARTE DE UNA EMPRESA CON UN PROPÃSITO CLARO: CONSTRUIR UNA MEJOR SOCIEDAD', 'formar-parte-de-una-empresa-con-un-propa', '', '<div class=\"w-col w-col-4 column-media2 process\">\r\n                    <h2 class=\"media-tittle _3\">FORMAR PARTE DE UNA EMPRESA CON UN PROPÃSITO CLARO: CONSTRUIR UNA MEJOR SOCIEDAD</h2><br>\r\n                    <ul>\r\n                        <li class=\"white\"> SerÃ¡s protagonista en la aventura de construir una nueva empresa</li>\r\n                        <li class=\"white\"> Trabajar directamente con los socios y aprender de sus experiencias </li>\r\n                        <li class=\"white\"> Transformarte en un lÃ­der integral, impulsor del cambio</li>\r\n                        <li class=\"white\"> SerÃ¡s parte de una consultora con propÃ³sito, apoyando a organizaciones sin fines de lucro</li>\r\n                    </ul>\r\n                </div>\r\n<div class=\"w-col w-col-8 column\">\r\n                    <p><img src=\"images/formar.png\"></p>\r\n                </div>', '', '', '', 2, 0, 0, '', '', '', '', '2015-03-20 15:10:01', '2018-07-17 09:14:14', 'admin', 'fran'),
(12, 'EN THE HOUSE', 'en-the-house', '', '<div class=\"w-col w-col-12 w-col-stack column-media\">\r\n                <p class=\"izquierda blog-text date centrar\">En The <strong></strong>House<strong></strong>:</p>  <br>\r\n                    <div class=\"w-row servis-row-2\">\r\n                        <div class=\"w-col w-col-6 w-clearfix\">\r\n                            <div class=\"service-icon third\">\r\n                                <img src=\"images/1_asesorar.png\">\r\n                            </div>\r\n                            <p class=\"features-text _2\">Asesorarás a grandes empresas y las apoyarás en qué decisión tomar o qué curso de acción seguir.\r\n</p>\r\n                        </div>\r\n                        <div class=\"w-col w-col-6 w-clearfix b-unete\">\r\n                            <div class=\"service-icon third\">\r\n                                <img src=\"images/4_aprendizaje.png\">\r\n                            </div>\r\n                            <p class=\"features-text _2\">Tendrás un desarrollo y un aprendizaje acelerado, dada la diversidad de industrias y temáticas que podrás conocer.\r\n</p>\r\n                        </div>\r\n                    </div>\r\n                    <div class=\"w-row servis-row-2\">\r\n                        <div class=\"w-col w-col-6 w-clearfix\">\r\n                            <div class=\"service-icon third\">\r\n                                <img src=\"images/2respaldo.png\">\r\n                            </div>\r\n                            <p class=\"features-text _2\">Siempre tendrás el respaldo de un gran equipo, con amplia experiencia.\r\n</p>\r\n                        </div>\r\n                        <div class=\"w-col w-col-6 w-clearfix b-unete\">\r\n                            <div class=\"service-icon third\">\r\n                                <img src=\"images/5_colaborativo.png\">\r\n                            </div>\r\n                            <p class=\"featu