ion-team\"><strong>Mínimo de años requeridos<br> para el cargo 4-5 Años</strong></p><br>\r\n                            <ul class=\"ulepacio\">\r\n                                <li>Estructurar el trabajo</li>\r\n                                <li>Liderar el diagnóstico, hipótesis y diseño de la propuesta al cliente</li>\r\n                                <li>Manejar el trabajo en equipo</li>\r\n                                <li>Desarrollar relaciones de confianza y largo plazo con nuestros clientes</li>\r\n                                <li>Promover el desarrollo  del equipo</li><br><br>\r\n                            </ul>                        </div>\r\n                    </div>\r\n                </div>\r\n                <div class=\"w-col w-col-3 team-column\">\r\n                    <div class=\"team-wrapper\">\r\n                        <img class=\"team\" src=\"archivos/cargos/socio.png\">\r\n                        <div class=\"team-tittle2\"><br>\r\n                           <!-- <h3 class=\"centar\">SOCIO</h3> -->\r\n                           <p class=\"tposition-team\"><strong>Mínimo de años requeridos<br> para el cargo 5-6 Años</strong></p><br>\r\n                            <ul class=\"ulepacio\">\r\n                                <li>Desarrollar nuevos clientes</li>\r\n                                 <li>Gestionar y fortalecer relación con clientes actuales</li>\r\n                                 <li>Liderar el desarrollo de propuestas y proyectos</li>\r\n                                 <li>Gestionar el desarrollo de sus equipos</li>\r\n                                 <li>Como último paso en la carrera, tendrá la posibilidad de transformarse en socio </li><br>\r\n                            </ul>                        </div>\r\n                    </div>\r\n                </div>\r\n            </div>\r\n        </div>\r\n                </div>', '', '', '', 1, 1, 0, '', '', '', '', '2015-03-20 15:14:41', '2018-08-07 16:31:50', 'admin', 'fran'),
